PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT DISTINCT ?band, COALESCE(SUM(?songCount), 0) AS ?totalSongs
WHERE {
  ?band a dbo:Band .

  OPTIONAL { ?band dbo:numberOfSongs ?songCount . }
  OPTIONAL { ?band dbpedia-owl:numberOfSongs ?songCount . }
  OPTIONAL { ?band dbo:tracks ?tracks .
    ?tracks dbo:song ?song .
    COUNT(?song) AS ?trackCount .
  }

  BIND (COALESCE(?songCount, ?trackCount, 0) AS ?totalSongs)
}

ORDER BY DESC (?totalSongs)

